import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "./Home";
import "tailwindcss/tailwind.css";
import { New } from "./core";

const App = () => (
  <Switch>
    <Route exact path="/">
      home
    </Route>
    <Route exact path="/new">
      <New />
    </Route>
  </Switch>
);

export default App;
